import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';
import * as ServiceWorker from './serviceWorker';

ReactDOM.render(
    <React.StrictMode>
    <App />, document.getElementById('root'));
    </React.StrictMode>,
    document.getElementById('root')
);

ServiceWorker.unregister();
